import React from "react";
import ReactDOM from "react-dom";

function MyList() {
  return (
  <ul>
    <li>1. Apple</li>
    <li>2. Banana</li>
    <li>3. Carrot</li>
  </ul>
  )
}

ReactDOM.render(
  <MyList />,
  document.getElementById("root")
);
